CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "logic_recordfields" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "username" varchar(100) NOT NULL, "email" varchar(254) NOT NULL, "home_page" varchar(100) NULL, "text" text NOT NULL, "photo" varchar(100) NULL, "time_created" datetime NOT NULL, "root_record_id" bigint NULL REFERENCES "logic_recordfields" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "logic_userfields" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "photo" varchar(100) NULL, "home_page" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "logic_userfields_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "userfields_id" bigint NOT NULL REFERENCES "logic_userfields" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
